  return (
    <Container>
        <SlideOne>
          <div className="header"></div>
        </SlideOne>
    </Container>
  )
}

export default Landing

const Container = styled.div`

`

const SlideOne = styled.div`
  width: 100vw;
  height: 100vh;
  /* background: #0B2447; */


  .header{
    height: 70px;
    border-bottom: 1px solid black;
  }
`
